// MyComponent.js
import React from 'react';

const MyComponent = () => {

  useEffect(() => {
    // Include external JavaScript files
    const jqueryScript = document.createElement("script");
    jqueryScript.src = "/assets/js/jquery.min.js";
    document.head.appendChild(jqueryScript);

    const skelScript = document.createElement("script");
    skelScript.src = "/assets/js/skel.min.js";
    document.head.appendChild(skelScript);

    const utilScript = document.createElement("script");
    utilScript.src = "./";
    document.head.appendChild(utilScript);

    // Cleanup function
    return () => {
      document.head.removeChild(jqueryScript);
      document.head.removeChild(skelScript);
      document.head.removeChild(utilScript);
    };
  }, []); // Empty dependency array to run this effect only once on mount

  return (
    <div className="landing">
      {/* Header */}
      <header id="header" className="alt">
        <h1><a href="index.html">BizCom-logo</a></h1>
        <a href="#nav">Menu</a>
      </header>

      {/* Nav */}
      <nav id="nav">
        <ul className="links">
          <li><a href="index.html">Home</a></li>
          <li><a href="about.html">About US</a></li>
          <li><a href="elements.html">Elements</a></li>
        </ul>
      </nav>

      {/* Banner */}
      <section id="banner">
        <i className="icon fa-laptop"></i>
        <h2>BizCom InfoTech Limited</h2>
        <p style={{ textTransform: 'none' }}>Your one-stop shop for the best affordable gadgets</p>
        <ul className="actions">
          <li><a href="#" className="button big special">View Store</a></li>
        </ul>
      </section>

      {/* One */}
      <section id="one" className="wrapper style1">
        <div className="inner">
          <article className="feature left">
            <span className="image"><img src="/images/pic01.jpg" alt="" width="576" height="358" /></span>
            <div className="content">
              <h2>About US</h2>
              <p>Sed egestas, ante et vulputate volutpat, eros pede semper est, vitae luctus metus libero eu augue. Morbi purus libero, faucibus adipiscing, commodo quis, gravida id, est...</p>
              <ul className="actions">
                <li><a href="about.html" className="button alt">More</a></li>
              </ul>
            </div>
          </article>
          <article className="feature right">
            <span className="image"><img src="images/pic02.jpg" alt="" width="576" height="358" /></span>
            <div className="content">
              <h2>Our Founder</h2>
              <p>Sed egestas, ante et vulputate volutpat, eros pede semper est, vitae luctus metus libero eu augue. Morbi purus libero, faucibus adipiscing, commodo quis, gravida id, est.</p>
              <ul className="actions">
                <li><a href="#" className="button alt">More</a></li>
              </ul>
            </div>
          </article>
        </div>
      </section>

      {/* Two */}
      <section id="two" className="wrapper special">
        <div className="inner">
          <header className="major narrow">
            <h2>Services</h2>
            <p>Ipsum dolor tempus commodo turpis adipiscing Tempor placerat sed amet accumsan</p>
          </header>
          <div className="image-grid">
            {/* Add your image grid elements here */}
          </div>
          <ul className="actions">
            <li><a href="#" className="button big alt">Tempus Aliquam</a></li>
          </ul>
        </div>
      </section>

      {/* Three */}
      <section id="three" className="wrapper style3 special">
        <div className="inner">
          <header className="major narrow">
            <h2>Magna sed consequat tempus</h2>
            <p>Ipsum dolor tempus commodo turpis adipiscing Tempor placerat sed amet accumsan</p>
          </header>
          <ul className="actions">
            <li><a href="#" className="button big alt">Magna feugiat</a></li>
          </ul>
        </div>
      </section>

      {/* Four */}
      <section id="four" className="wrapper style2 special">
        <div className="inner">
          <header className="major narrow">
            <h2>Get in touch</h2>
            <p>Ipsum dolor tempus commodo adipiscing</p>
          </header>
          <form action="#" method="POST">
            <div className="container 75%">
              <div className="row uniform 50%">
                <div className="6u 12u$(xsmall)">
                  <input name="name" placeholder="Name" type="text" />
                </div>
                <div className="6u$ 12u$(xsmall)">
                  <input name="email" placeholder="Email" type="email" />
                </div>
                <div className="12u$">
                  <textarea name="message" placeholder="Message" rows="4"></textarea>
                </div>
              </div>
            </div>
            <ul className="actions">
              <li><input type="submit" className="special" value="Submit" /></li>
              <li><input type="reset" className="alt" value="Reset" /></li>
            </ul>
          </form>
        </div>
      </section>

      {/* Footer */}
      <footer id="footer">
        <div className="inner">
          <ul className="icons">
            <li><a href="#" className="icon fa-facebook"><span className="label">Facebook</span></a></li>
            <li><a href="#" className="icon fa-twitter"><span className="label">Twitter</span></a></li>
            <li><a href="#" className="icon fa-instagram"><span className="label">Instagram</span></a></li>
            <li><a href="#" className="icon fa-linkedin"><span className="label">LinkedIn</span></a></li>
          </ul>
        </div>
      </footer>

      <div className="copyright">
        {/* Made with: <a href="https://templated.co/">TEMPLATED</a> */}
      </div>

      {/* Scripts */}
{/* <script src="https://code.jquery.com/jquery-3.6.4.min.js"></script> */}

      {/* <script src="/assets/js/jquery.min.js"></script> */}
      {/* <script src="/assets/js/skel.min.js"></script> */}
      {/* <script src="/assets/js/util.js"></script> */}
      {/* {[if lte IE 8]><script src="assets/js/ie/respond.min.js"></script><![endif]} */}
      {/* <script src="/assets/js/main.js"></script> */}
    </div>
  );
};

export default MyComponent;
